const user = this.credentials.usuarioParabank;
_parabankService.default.loginAPI(user.username, user.password).then(resp => {
  expect(resp.status).to.eq(200);
  cy.log(JSON.stringify(resp.body));
  Cypress.env('customerId', resp.body.id); //Guardamos el id del cleinte ingresado
});

_parabankService.default.getAccounts(Cypress.env('customerId')).then(resp => {
  expect(resp.status).to.eq(200);
  cy.log(JSON.stringify(resp.body));
  Cypress.env('accounts', resp.body); //Guardamos las cuentas del cliente
});

const tipoCuenta = [0, 1]; //0 = Savings 1 = Checking
const Cuentas = Cypress.env('accounts'); //Cuentas guardadas del cliente
const fromAccountId = Cuentas[0].id; //Usamos la cuenta origen del cliente
_parabankService.default.createAccount(Cypress.env('customerId'), fromAccountId, tipoCuenta[1]).then(resp => {
  expect(resp.status).to.eq(200);
  cy.log(JSON.stringify(resp.body));
  Cypress.env('newAccountId', resp.body); //Guardamos el id de la nueva cuenta
});

const Cuentas = Cypress.env('accounts'); //Cuentas guardadas del cliente
const accountId = Cuentas[0].id; //Detalle de la cuenta n
const tipoCuenta = ['SAVINGS', 'CHECKING']; //Tipos de cuenta
_parabankService.default.getAccountDetail(accountId).then(resp => {
  expect(resp.status).to.eq(200);
  cy.log(JSON.stringify(resp.body));
  if (resp.body.type == 'SAVINGS') {
    expect(resp.body.type).to.eq(tipoCuenta[0]);
  } else {
    expect(resp.body.type).to.eq(tipoCuenta[1]);
  }
});

const Cuentas = Cypress.env('accounts'); //Cuentas guardadas del cliente
const fromAccount = Cuentas[1].id; //cuenta origen
const toAccount = Cuentas[3].id; //cuenta detino
const amount = 730; //Monto
_parabankService.default.transferFunds(fromAccount, toAccount, amount).then(resp => {
  expect(resp.status).to.eq(200);
  cy.log(JSON.stringify(resp.body));
  expect(resp.body).to.include(fromAccount);
  expect(resp.body).to.include(toAccount);
  expect(resp.body).to.include(amount);
});
